// HasBeneficialOwners applies the HasEdge predicate on the "beneficial_owners" edge.
func HasBeneficialOwners() predicate.KYBFormSubmission {
	return predicate.KYBFormSubmission(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, BeneficialOwnersTable, BeneficialOwnersColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasBeneficialOwnersWith applies the HasEdge predicate on the "beneficial_owners" edge with a given conditions (other predicates).
func HasBeneficialOwnersWith(preds ...predicate.BeneficialOwner) predicate.KYBFormSubmission {
	return predicate.KYBFormSubmission(func(s *sql.Selector) {
		step := newBeneficialOwnersStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

